    display: flex;
    align-items: center;
    position: relative; 
    transition: max-height 0.25s ease-in;  
    max-height: 300px;
}

.commands-fade-out {
    max-height: 0px;
    overflow: hidden;
    animation: commandFadeOut 0.25s ease-in forwards;
}

@keyframes commandFadeOut {
    0% {
        opacity: 100%;
    }

    100% {
        opacity: 0%;
        display: none !important;
    }

}

.commands-fade-out * {
    animation: commandFadeOutInner 0.5s ease-in forwards;
}

@keyframes commandFadeOutInner {
    50% {
        display: none !important;
    }
}
```

